const loaded = () => {
    return {
        type: 'LOADED'
    }
}

const erorr = (bool) => {
    return {
        type: 'ERROR',
        payload: bool
    }
}

const logout = () => {
    return {
        type: 'LOGOUT'
    }
}

const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

const getAllUsers = (allUsers) => {
    return {
        type: 'ALL_USERS',
        payload: allUsers
    }
}

const posts = (posts) => {
    return {
        type: 'POSTS',
        payload: posts
    }
}

const setPost = (post) => {
    return {
        type: 'POST',
        payload: post
    }
}

const setPostUser = (user) => {
    return {
        type: 'POST_USER',
        payload: user
    }
}

const remove = (action) => {
    return {
        type: 'DELETED',
        payload: action
    }
}

export {
    addUser,
    logout,
    erorr,
    getAllUsers,
    posts,
    setPost,
    setPostUser,
    loaded,
    remove

}
